import React from "react";
import "./Especialidades.css";
import imgchef from "../assets/imgchef.jpg";

const Especialidades = () => {
  return (
    <div className="especialidades-container">
      <h1>The Chef</h1>

      <div className="especialidades-conteudo">
        <div className="especialidades-imagem">
          <img className="chef-imagem" src={imgchef} alt="Chef do restaurante" />
        </div>

        <div className="especialidades-texto">
          <p className="especialidades-descricao">
            Nossa equipe é liderada por uma chef talentosa e experiente,
            que traz ao Maison Nordic uma visão única e inovadora da culinária. 
            Com uma trajetória internacional, expertise e criatividade,
            explora cozinhas ao redor do mundo, trazendo para o restaurante
            a autenticidade dos sabores nórdicos e a sofisticação da gastronomia
            francesa. Sempre aberta a novas experiências e técnicas, ela
            combina ingredientes frescos e inusitados, transformando cada prato
            em uma descoberta.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Especialidades;
